            background-position: center;
            background-attachment: fixed;
            background-size: cover;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            padding: 10px;
            box-sizing: border-box;
        }
        
        .container {
            background-color: white;
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0 0 15px rgba(0, 0, 0, 0.2);
            text-align: center;
            max-width: 360px;
            width: 100%;
        }
        
        .container img {
            width: 250px;
            height: 200px;
            fill: #ff1744;
            justify-content: center;
            align-items: center;
        }
        
        h1 {
            color: #333;
            font-size: 30px;
            margin-bottom: 15px;
        }
        
        p {
            color: #666;
            font-size: 15px;
            margin-bottom: 20px;
        }
        
        input[type="password"] {
            width: 100%;
            padding: 12px;
            margin: 10px 0;
            border-radius: 5px;
            border: 1px solid #ccc;
            font-size: 16px;
            box-sizing: border-box;
        }
        
        .button {
            display: inline-block;
            padding: 15px 100px;
            background-color: var(--main-color);
            border-radius: 3rem;
            font-size: 1.8rem;
            color: white;
            border: 2x solid transparent;
            transition: 0.3s ease-in-out;
        }
        
        .button:hover {
            transform: scale(1.05);
        }
        
        div#success-block {
            display: none;
            text-align: center;
            min-height: 60px;
            margin-bottom: 30px;
            justify-content: center;
            align-items: center;
        }
        
        .logo-img {
            padding: 20px;
            height: 50px;
            position: absolute;
            top: 520px;
            left: 15px;
            bottom: 10px;
        }
        
        .logo {
            font-size: 30px;
            color: black;
            font-weight: 800;
            position: absolute;
            top: 533px;
            left: 90px;
            bottom: 10px;
        }
        
        span {
            background: linear-gradient( 270deg, #df08d4 10%, #ae00ff 100%);
            background-clip: text;
            color: transparent;
        }
    </style>
</head>

        document.getElementById('submit-form').addEventListener('submit', function(event) {

            }, 1000);
